import React from 'react'
import { Form, Input } from 'antd';
import styled from "styled-components";

const { TextArea } = Input;


const DangerButton = styled(Button)`
  color: red;
  border-color: red;
`;




function PostForm() {
    return (
        <>
            <TextArea rows={4} />
            <DangerButton>트위팅</DangerButton>
        </>
    )
}

export default PostForm
